import Tree from "../models/Tree";

class TreeNode {
  constructor(value) {
    this.value = value;
    this.left = null;
    this.right = null;
  }
}

// Funcin para imprimir un nodo de un rbol binario
function insertNode(root, value) {
  if (!root) {
    return new TreeNode(value);
  }

  if (value < root.value) {
    root.left = insertNode(root.left, value);
  } else {
    root.right = insertNode(root.right, value);
  }

  return root;
}

// Funcin para construir un rbol binario a partir de un array de nmeros
function constructBinaryTree(numbers) {
  if (!numbers || numbers.length === 0) {
    return null;
  }

  let root = null;
  for (const num of numbers) {
    root = insertNode(root, num);
  }

  return root;
}

function printTree(root, space = 0, count = 5) {
  if (!root) {
    return;
  }

  space += count;

  // Imprimir el subrbol derecho
  printTree(root.right, space);

  // Imprimir el nodo actual
  console.log(" ".repeat(space - count) + root.value);

  // Imprimir el subrbol izquierdo
  printTree(root.left, space);
}

// Funcin para manejar la insercin de un nuevo nodo en el rbol
async function addNode(req, res) {
  try {
    const numberReq = req.body.number;
    const newNode = new Tree({ number: Number(numberReq) });
    // Construye el rbol binario a partir de los valores encontrados
    await newNode.save();
    const treeNodes = await Tree.find().lean();
    const numberos = treeNodes.map(node => node.number);
    const root = constructBinaryTree(numberos);
    printTree(root);

  } catch (error) {
    console.error('Error al insertar el nodo:', error);
    res.status(500).json({ error: 'Ocurri un error al insertar el nodo' });
  }
}

// Funcin para manejar la bsqueda de un nodo en el rbol
async function searchNode(req, res) {
  try {
    const { number } = req.params;
    const node = await Tree.findOne({ number });
    if (node) {
      res.status(200).json({ message: 'Nodo encontrado', node });
    } else {
      res.status(404).json({ message: 'Nodo no encontrado' });
    }
  } catch (error) {
    console.error('Error al buscar el nodo:', error);
    res.status(500).json({ error: 'Ocurri un error al buscar el nodo' });
  }
}

// Funcin para manejar la eliminacin de un nodo del rbol
async function deleteNode(req, res) {
  try {
    const { number } = req.body;
    const deletedNode = await Tree.findOneAndDelete({ number });
    const treeNodes = await Tree.find().lean();
    const numberos = treeNodes.map(node => node.number);
    const root = constructBinaryTree(numberos);
    if (deletedNode) {
